/* Procedure structure for procedure `getCurrentPrice` */

/*!50003 DROP PROCEDURE IF EXISTS  `getCurrentPrice` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getCurrentPrice`(companyId_in int)
BEGIN
	select `LTP`
	from `indexdata`
	where `companyId` = companyId_in and `is_viewable`=1;

	END */$$
DELIMITER ;

/* Procedure structure for procedure `getGainersLosers` */

/*!50003 DROP PROCEDURE IF EXISTS  `getGainersLosers` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getGainersLosers`(date_in varchar(50),min_val double,max_val double, type_in int)
BEGIN
	
	SELECT `company_id`,`companyName`,`open`,`high`,`low`,`last_price`,`change`,`perc_change`,`date`
	FROM `gainers_losers` g JOIN `indexcompany` i ON g.`company_id` = i.id
	WHERE DATE(`date`) = DATE(date_in) AND `perc_change`>=min_val AND `perc_change`<=max_val AND `type`=type_in;
	
	


	END */$$
DELIMITER ;

/* Procedure structure for procedure `getIndexData` */

/*!50003 DROP PROCEDURE IF EXISTS  `getIndexData` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getIndexData`(

)
BEGIN

	
	SELECT `companyId`,`companyName`,`LTP`,`change`,`volume`,`buyPrice`,`sellPrice`,`buyQty`,`sellQty` 
	FROM indexdata idx JOIN `indexcompany` ic
	ON idx.`companyId` = ic.`id`
	WHERE is_viewable = 1;

	END */$$
DELIMITER ;

/* Procedure structure for procedure `getNiftyPrices` */

/*!50003 DROP PROCEDURE IF EXISTS  `getNiftyPrices` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getNiftyPrices`()
BEGIN
		SELECT `companyId`,`LTP`
		FROM `indexdata`
		WHERE companyId = 51
		ORDER BY id DESC
		LIMIT 50;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `getOpenPosition` */

/*!50003 DROP PROCEDURE IF EXISTS  `getOpenPosition` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getOpenPosition`()
BEGIN
		SELECT `id`,`company_id`,`transcation_type`,`target`,`stoploss`,`volume`
		FROM `user_transcation`
		WHERE `is_completed`=0;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `getPreviousDays` */

/*!50003 DROP PROCEDURE IF EXISTS  `getPreviousDays` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getPreviousDays`(date_in varchar(50))
BEGIN
		select  DATE(`trading_date`)
		from `market_dates`
		where `trading_date`<date_in
		ORDER BY trading_date DESC
		limit 1;

	END */$$
DELIMITER ;

/* Procedure structure for procedure `getPreviousMinuteWiseData` */

/*!50003 DROP PROCEDURE IF EXISTS  `getPreviousMinuteWiseData` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getPreviousMinuteWiseData`( companyId_in INT)
BEGIN
				SELECT `companyId`, `companyName`,`LTP`, MIN(`insertedDateTime`)
		FROM indexdata idx JOIN `indexcompany` ic
	ON idx.`companyId` = ic.`id`
		WHERE companyId =companyId_in
		GROUP BY DATE(`insertedDateTime`), HOUR(`insertedDateTime`), MINUTE(`insertedDateTime`);
	END */$$
DELIMITER ;

/* Procedure structure for procedure `getTodaysWishlist` */

/*!50003 DROP PROCEDURE IF EXISTS  `getTodaysWishlist` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `getTodaysWishlist`(date_in varchar(50))
BEGIN
	
	select `company_id`,`g_l_type`
	from `wishlist`
