/* Procedure structure for procedure `insertTransaction` */

/*!50003 DROP PROCEDURE IF EXISTS  `insertTransaction` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `insertTransaction`(
   
    `user_id_in` INT,
    `company_id_in` INT,
    `transcation_type_in` INT,
    `unit_price_in` DOUBLE,
    `volume_in` INT,
    `total_amount_in` DOUBLE,
    `target_in` DOUBLE,
    `stoploss_in` DOUBLE,
    `is_completed_in` INT,
    `transcation_date_in` varchar(50),
    transaction_of_id_in int)
BEGIN
	
	INSERT INTO `user_transcation`(`user_id`,`company_id`,`transcation_type`,`unit_price`,`volume`,`total_amount`,`target`,`stoploss`,`is_completed`,`transcation_date`)
	VALUES(`user_id_in` ,`company_id_in` ,`transcation_type_in` ,`unit_price_in` ,`volume_in` ,`total_amount_in` ,`target_in` ,`stoploss_in`,`is_completed_in`,`transcation_date_in` );

	if transcation_type_in = 1 and transcation_type_in = 3 then
	
		update `wishlist`
		set `is_transcated`=1
		where `company_id`= company_id_in and Date(`ondate`) = date(transcation_date_in);
	
	else
	UPDATE `wishlist`
		SET `is_transcated`=0
		WHERE `company_id`= company_id_in AND DATE(`ondate`) = DATE(transcation_date_in);
	end if;
	
	if transaction_of_id_in <> 0 then
		update user_transcation
		set is_completed = 1
		where id = transaction_of_id_in;
	End if;
	
	



	END */$$
DELIMITER ;

